// PrintJobComponentStyles.js
const printJobContainerStyle = {
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  margin: '20px',
};

const fileInputStyle = {
  margin: '5px',
  padding: '8px',
};

const inputFieldStyle = {
  margin: '5px',
  padding: '8px',
};

const createJobButtonStyle = {
  marginTop: '10px',
  padding: '8px',
  cursor: 'pointer',
};

const successMessageStyle = {
  color: 'green',
  fontWeight: 'bold',
  margin: '10px 0',
};

export { printJobContainerStyle, fileInputStyle, inputFieldStyle, createJobButtonStyle, successMessageStyle };
